#include <stdlib.h>
#include <stdio.h>
#include <time.h>


#define N_LEN 300   //250
#define G_LEN 10

void zash(int G[G_LEN]){
    for(int len_n = 100; len_n < 2000; len_n += 50) // Ğ”Ğ»Ğ¸Ğ½Ğ½Ğ° Ğ´Ğ°Ñ‚Ñ‹ Ğ¾Ñ‚ 100 Ğ´Ğ¾ 2000
    {
        int kk=0;
        for(int package = 0; package < 50; package++) // Ğ”Ğ»Ñ ĞºĞ°Ğ¶Ğ´Ğ¾Ğ¹ Ğ´Ğ»Ğ¸Ğ½Ğ½Ñ‹ 50 Ñ€Ğ°Ğ·Ğ½Ñ‹Ñ… Ğ¼Ğ°ÑÑĞ¸Ğ²Ğ¾Ğ²
        {
            int No[len_n]; int No_c[len_n];
            for(int i = 0; i<len_n-G_LEN+1; i++){ // Ğ¡Ğ¾Ğ·Ğ´Ğ°Ñ‘Ğ¼ 2 Ğ¾Ğ´Ğ¸Ğ½Ğ°ĞºĞ¾Ğ²Ñ‹Ñ… Ğ¼Ğ°ÑÑĞ¸Ğ²Ğ°
                No[i] = rand() % 2;
                No_c[i] = No[i];
            }
            // Ğ”Ğ¾Ğ±Ğ°Ğ²Ğ»ĞµĞ½Ğ¸Ğµ Ğ½ÑƒĞ»ĞµĞ¹ Ğ² ĞºĞ¾Ğ½ĞµÑ† No[]
            for(int i = len_n-G_LEN+1; i < len_n; i++) No[i] = 0; 

            // Ğ’Ñ‹Ñ‡Ğ¸ÑĞ»ĞµĞ½Ğ¸Ğµ XOR Ğ¸ Ğ¾ÑÑ‚Ğ°Ñ‚ĞºĞ° Ğ¾Ñ‚ Ğ´ĞµĞ»ĞµĞ½Ğ¸Ñ
            for(int i=0; i < len_n-G_LEN+1; i++){
                if(No[i] == 1){
                    for(int j=0; j < G_LEN; j++) 
                    No[i+j] ^= G[j];
                }
            }
            // Ğ”Ğ¾Ğ±Ğ°Ğ²Ğ»ĞµĞ½Ğ¸Ğµ Ğ¾ÑÑ‚Ğ°Ñ‚ĞºĞ°(CRC) Ğº No_c[]
            for(int i=len_n-G_LEN+1; i < len_n; i++) No_c[i] = No[i];

            int k=0;
            for(int o = 0; o<len_n; o++){ // Ğ˜ÑĞºĞ°Ğ¶Ğ°ĞµĞ¼ 1 Ğ±Ğ¸Ñ‚ Ğ¿Ğ¾ÑĞ»ĞµĞ´Ğ¾Ğ²Ğ°Ñ‚ĞµĞ»ÑŒĞ½Ğ¾ + 1 Ñ€Ğ°Ğ½Ğ´Ğ¾Ğ¼Ğ½Ğ¾
                int No_cc[len_n];
                for(int i = 0; i<len_n; i++) No_cc[i] = No_c[i]; // ĞšĞ¾Ğ¿Ğ¸Ñ€ÑƒĞµĞ¼ Ğ¼Ğ°ÑÑĞ¸Ğ² Ñ CRC Ğ½Ğ° No_cc[]

                // Ğ˜ÑĞºĞ°Ğ¶ĞµĞ½Ğ¸Ğµ Ğ±Ğ¸Ñ‚Ğ¾Ğ² Ğ¿Ğ¾ Ğ¾Ñ‡ĞµÑ€ĞµĞ´Ğ¸
                if (No_cc[o] == 1) No_cc[o] = 0;
                else No_cc[o] = 1;
                // Ğ˜ÑĞºĞ°Ğ¶ĞµĞ½Ğ¸Ğµ Ñ€Ğ°Ğ½Ğ´Ğ¾Ğ¼Ğ½Ñ‹Ñ… Ğ±Ğ¸Ñ‚Ğ¾Ğ²
                if (No_cc[rand()%len_n] == 1) No_cc[rand()%len_n] = 0;
                else No_cc[rand()%len_n] = 1;

                // Ğ’Ñ‹Ñ‡Ğ¸ÑĞ»ĞµĞ½Ğ¸Ğµ XOR Ğ¸ Ğ¾ÑÑ‚Ğ°Ñ‚ĞºĞ° Ğ¾Ñ‚ Ğ´ĞµĞ»ĞµĞ½Ğ¸Ñ
                for(int i=0; i < len_n-G_LEN+1; i++){
                    if(No_cc[i] == 1){
                        for(int j=0; j < G_LEN; j++)
                        No_cc[i+j] ^= G[j];
                    }
                }
                // ĞŸÑ€Ğ¾Ğ²ĞµÑ€ĞºĞ° Ğ½Ğ° Ğ¾ÑˆĞ¸Ğ±ĞºĞ¸
                for(int i = len_n-G_LEN+1; i<len_n; i++){
                    if(No_cc[i] == 1) break;
                    if((i == len_n-1) & (No_cc[i] == 0)) k++;
                }
            }
            kk += k;
        }
        double err = (double)kk/(double)(len_n*50);
        fflush(stdout);
        printf("%f, ", err);
    }
}

int main(){
