    for(int i=N_LEN-G_LEN+1; i < N_LEN; i++) printf("%d", N[i]);
    printf(" <- CRC \n\n");

    // Ğ”Ğ¾Ğ±Ğ°Ğ²Ğ»ĞµĞ½Ğ¸Ğµ Ğ¾ÑÑ‚Ğ°Ñ‚ĞºĞ°
    for(int i=N_LEN-G_LEN+1; i < N_LEN; i++){
    N_c[i] = N[i];
