    }
    //Ğ’Ñ‹Ğ²Ğ¾Ğ´ N Ğ¿Ñ€Ğ¸ Ğ¿Ğ¾Ğ»ÑƒÑ‡ĞµĞ½Ğ¸Ğ¸
    for(int i=0; i < N_LEN; i++) printf("%d", N_c[i]);
    printf(" <- N_c\n");

     // Ğ¾Ğ¿ÑÑ‚ÑŒ Ğ¿Ğ¾Ğ´ÑÑ‡ĞµÑ‚ XOR Ğ¸ Ğ¾ÑÑ‚Ğ°Ñ‚ĞºĞ° Ğ¾Ñ‚ Ğ´ĞµĞ»ĞµĞ½Ğ¸Ñ    
    for(int i=0; i < N_LEN-G_LEN+1; i++){
            if(N_c[i] == 1){
                for(int j=0; j < G_LEN; j++)
